import Header from "../layout/Header";
import DownloadTicket from "../components/DownloadTicket";
import Footer from "../layout/Footer";
const DownloadTicketPage = () => {
  return (
    <div>
      <Header />
      <DownloadTicket />
      
      <Footer />
    </div>
  );
};

export default DownloadTicketPage;
